import React from "react";


import classes from './TopInfoBar.module.css';
import TopInfoBarInstructor from './TopInfoBarInstructor';
import TopInfoBarButton from './TopInfoBarButton.js';

const TopInfoBar=()=>{


let buttonName='Settings';




return (



<div className={classes.topInfoBar}>

       <TopInfoBarInstructor/>

       <TopInfoBarButton buttonName={buttonName}/>

       <TopInfoBarButton buttonName={buttonName}/>

        <div className={classes.topInfoBar__settingsbtn}> Settings  </div>

        <div className={classes.topInfoBar__coursesbtn}> Courses  </div>



</div>



);

}


export default TopInfoBar;
